import * as React from "react";
const Logo = ({size}) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 15000 15000"
    width={size}
    height={size}
    className="mix-blend-difference"
  >
    <title>{"Modern-Owl-Logo"}</title>
    <defs>
      <image
        width={430}
        height={623}

        id="img1"
        href="data:image/png;base64,"
      />
    </defs>
    <style />
    <use
      id="Layer 2"
      href="#img1"
      transform="matrix(23.157,0,0,23.157,2194.444,291.667)"
    />
  </svg>
);
export default Logo;
